  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides the results of the
  Refuge Vulnerability Assessment (RVA) for the Sheldon National Wildlife Refuge and
  Hart Mountain National Antelope Refuge Complex (Refuge Complex). The purpose of
  the RVA is to assess the cumulative impacts of stressors on refuge resources over
  multiple timeframes and develop mitigation and adaptation strategies to address
  those impacts. Both spatial and non-spatial models were used to assess resource
  response to land use and environmental stressors. Spatial models looked specifically
  at snapshots in time at 2010 and 2025, while non-spatial assessments produced continuous
  results from 2000 to 2100.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
